import React from "react";
import particle_data from "particlesjs";

class Particles extends React.Component {
  componentDidMount() {
    particle_data.init({
      selector: ".particles"
    });
  }

  render() {
    return <canvas class="particles"></canvas>;
  }
}

export default Particles;
